import React from 'react';
import { Link } from 'react-router-dom';

function PostCard({ post }) {
  return (
    <div className="border rounded-xl shadow p-4">
      <h2 className="text-xl font-semibold mb-2">{post.title}</h2>
      <p className="text-sm text-gray-500 mb-1">Location: {post.location}</p>
      <p className="text-sm text-gray-500 mb-2">Cost: ${post.cost}</p>
      <div className="flex gap-2 overflow-x-auto">
        {post.mediaUrls?.slice(0, 3).map((url, i) => (
          <img key={i} src={url} alt="post media" className="w-24 h-24 object-cover rounded" />
        ))}
      </div>
      <div className="mt-3">
        <Link to={`/post/${post.id}`} className="text-blue-600 hover:underline">View Details</Link>
      </div>
    </div>
  );
}

export default PostCard;
